import React from 'react';

// Styles for the container that holds the text and links
const containerStyle = {
    display: 'flex',
    flexDirection: 'column', // Stack items vertically
    alignItems: 'flex-end', // Align all items to the right
    paddingTop: '20px', // Add space at the top
};

// Styles for the main text
const textStyle = {
    fontSize: '16px',
    fontWeight: 'bold',
    textAlign: 'right', // Align the text to the right
};

// Styles for link text
const linkStyle = {
    fontSize: '16px',
    fontWeight: 'bold',
    textAlign: 'right', // Align the link text to the right
    marginTop: '10px', // Add space between elements
};

export default function MorePage() {
    return (
        <div style={containerStyle}>
            {/* Add empty lines for spacing */}
            <p>&nbsp;</p>
            <p>&nbsp;</p>
            <p>&nbsp;</p>

            {/* Main text */}
            <p style={textStyle}>
                {/* Add your text here */}
                לנוחיותכם אספנו מספר מקורות מידע, אתרים וקווים חמים בנושא חרמות
            </p>

            {/* Add extra space between text and first link */}
            <p>&nbsp;</p>
            <p>&nbsp;</p>
            <p>&nbsp;</p>

            {/* First link */}
            <p>
                <a href="https://matzmichim.org.il/boycott" target="_blank" rel="noopener noreferrer" style={linkStyle}>
                    {/* Add your first link text here */}
                    התמודדות עם חרם חברתי
                </a>
            </p>

            {/* Add extra space between links */}
            <p>&nbsp;</p>
            <p>&nbsp;</p>
            <p>&nbsp;</p>

            {/* Second link */}
            <p>
                <a href="https://www.yamshelhaverim.org.il/" target="_blank" rel="noopener noreferrer" style={linkStyle}>
                    {/* Add your second link text here */}
                    עמותת ים של חברים - חרם חברתי
                </a>
            </p>

            {/* Add space after the second link */}
            <p>&nbsp;</p>
            <p>&nbsp;</p>
            <p>&nbsp;</p>

            {/* Add more content here if needed */}
        </div>
    );
}
